// src/components/NavBar.js
import React from 'react';
import './NavBar.css';
import { useMain } from '../states/main_state'; // adjust the path as necessary

const NavBar = () => {
    const { currentMain } = useMain();
    const [isMenuOpen, setIsMenuOpen] = useState(false);

    const toggleMenu = () => {
      setIsMenuOpen(!isMenuOpen);
    };

    var navbar_title
    if (currentMain === "home_main"){navbar_title = "SKYGPU.NET"}
    if (currentMain === "intro_main"){navbar_title = "SKYNET intro"}
    if (currentMain === "alfa_main"){navbar_title = "SKYNET ALFA"}
    if (currentMain === "beta_main"){navbar_title = "SKYNET BETA"}

    return (
        <nav className="navbar">
        <div className="navbar-container">
            <div className="navbar-brand">
            <img src="https://avatars.githubusercontent.com/u/151031767?s=64&v=4" alt="Icon" className="navbar-icon" />
            <span className="navbar-title">{navbar_title}</span>
            </div>
            <ul className="navbar-menu">
            <li className="navbar-item">
                <a href="#" className="navbar-link">
                /Root
                </a>
                {isMenuOpen && <Menu />} {/* Show Menu component when isMenuOpen is true */}
            </li>

            </ul>
        </div>
        </nav>
    );
};

export default NavBar;
